    false,nt"url": null,nt"notes": "NCEI Accession 0129518 contains raw underway
    meteorological, navigational, physical and time series data logged by the Scientific
    Computer System (SCS) aboard NOAA Ship Thomas Jefferson in the North Atlantic Ocean
    from 2015-04-27 to 2015-06-21. Office of Marine and Aviation Operations (OMAO) personnel
    aboard the ship submitted these data and associated metadata to NCEI. In addition,
    NCEI Accession 0129518 contains supplementary cruise-level metadata, which OMAO
    personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NCEI personnel
    developed the automated process to archive these data under the auspices of the
    NOAA Rolling Deck to Repository (NOAA R2R) program.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
